@investing・88 Miners: We plan to roll out the following simple algorithm, to encourage allocations in assets other than cash:

`score *= max(1 - cash_alloc, 0.01)`

It will go live sometime this week. Please adjust your strategy in advance to avoid sudden drop in score. Appreciate feedback as always for possible further improvement.

@InfiniTao 
hi, can you please tell me after how many days of a miner's presence in the subnet are the 2 best days subtracted from his result, as random? 
I see several miners who received scores after 1 day in the subnet and their results did not suffer

@investing・88Friendly reminder to our miners:

To curb UID spam, we will roll out the hotkey/coldkey stake requirement soon. It will be a phased increase over a span of a few days, starting with 64 alpha per hotkey, ramping up to 256. The total stake requirement will be reflected on the parent coldkey.

Please be prepared in advance in order to avoid interruption when submitting strategies.

