@InfiniTao 
i remember we discussed about miner activity issue, the current top 1 miner was last active 19 days ago? we still accept this till now? why don't we have any mechanism to prevent this?

In my opinion, we should set a certain time like a periodic so that the miner must always be active no matter how little or much, for example, there must be an update every 2-3 days. If it is overdue and not updated, reset the score to 0 and calculate again from the beginning.
